import React from 'react';
import './App.css';

function App() {
  return (
    <div>

      <div>
        <h3>N Y B  Clothing</h3>
      </div>

      <div class="navbar">
        <a href="#home">Home</a>
        <a href="#news">News</a>
        <div class="dropdown">
          <button class="dropbtn">Dropdown
            <i class="fa fa-caret-down"></i>
          </button>
          <div class="dropdown-content">
            <a href="#">Link 1</a>
            <a href="#">Link 2</a>
            <a href="#">Link 3</a>
          </div>
        </div>
      </div>

    </div>
  );
}

export default App;
